import { Chart, Axis, Tooltip, Polygon, Line, Point} from 'viser-react';


import * as React from 'react';
import * as $ from 'jquery';
const DataSet = require('@antv/data-set');


const data = [
  { year: '1991', value: 3 },
  { year: '1992', value: 4 },
  { year: '1993', value: 3.5 },
  { year: '1994', value: 5 },
  { year: '1995', value: 4.9 },
  { year: '1996', value: 6 },
  { year: '1997', value: 7 },
  { year: '1998', value: 9 },
  { year: '1999', value: 13 },
];
const scale = [
            {
                dataKey: 'value',
                type: 'cat',
                values: ['Alexander', 'Marie', 'Maximilian', 'Sophia', 'Lukas', 'Maria', 'Leon', 'Anna', 'Tim', 'Laura']
            },
            {
                dataKey: 'name',
                type: 'cat',
                values: ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday']
            }
        ];


class Reactjs extends React.Component {

    render() {

        return (
         <Chart forceFit height={400} data={data} scale={scale}>



                <Axis
                    dataKey="day"
                    title={null}
                    grid={
                        {
                            align: 'center',
                            lineStyle: {
                                lineWidth: 1,
                                lineDash: [2, 2],
                                stroke: '#d9d9d9'
                            },
                            // showFirstLine: true
                        }
                    }
                />
                <Tooltip />


                 <Line position="name*value" />


            </Chart>
        );
    }
}
export default Reactjs
